import React from 'react';

import './Preview.scss';

const Preview: React.FC = () => {
  return (
    <div className="collectibles-preview">
      <h1 className="collectibles-preview__title h1-md text-bold text-white">Collectibles</h1>
    </div>
  );
};

export default Preview;
